import axios from 'axios';
import React, { useEffect, useState } from 'react';
import Tile from './Tile';

function ListHolder(props) {
    const [searchData, setSearchData] = useState([]);
    const [dataReady, setDataReady] = useState(false);

    async function hitAPIForSearch(query = "") {
        if(query !== "") {
            console.log("Hi");
            const response = await axios.get(`${props.apiURL}?s=${query}&apikey=${props.apiKey}`);
            setSearchData(response.data);
            setDataReady(true);
        }
    }

    useEffect(() => hitAPIForSearch(props.searchTerm));

    // console.log(searchData);

    return (<div>
        <h1>List of Items</h1>
        <Tile imgSrc={"https://m.media-amazon.com/images/M/MV5BMTczNTI2ODUwOF5BMl5BanBnXkFtZTcwMTU0NTIzMw@@._V1_SX300.jpg"} 
              alt={"Iron Man"}
              name={"Iron Man"}
              id={"tt0371746"} />
    </div>);
}

export default ListHolder;
